CREATE DEFINER=`user`@`%` PROCEDURE `sp_reporte_ventas`(
    IN filtro VARCHAR(10),
    IN fecha_param VARCHAR(20)
)
BEGIN
    -- Declarar variables para fechas ajustadas
    DECLARE fecha_actual DATE;
    DECLARE fecha_inicio DATE;
    DECLARE fecha_fin DATE;
    DECLARE fecha_seleccionada DATE;
    DECLARE anio_seleccionado INT;
    DECLARE semana_seleccionada INT;
    DECLARE mes_seleccionado INT;

    -- Validar el parámetro filtro
    IF filtro NOT IN ('diario', 'semanal', 'mensual') THEN
        SIGNAL SQLSTATE '45000' 
        SET MESSAGE_TEXT = 'Filtro no válido. Use: diario, semanal o mensual';
    END IF;

    -- Procesar la fecha según el filtro seleccionado
    IF filtro = 'diario' THEN
        -- Para filtro diario, usar la fecha directamente
        SET fecha_seleccionada = STR_TO_DATE(fecha_param, '%Y-%m-%d');
        SET fecha_inicio = fecha_seleccionada;
        SET fecha_fin = DATE_ADD(fecha_seleccionada, INTERVAL 1 DAY);
        
    ELSEIF filtro = 'semanal' THEN
        -- Para filtro semanal, extraer año y semana
        SET anio_seleccionado = SUBSTRING(fecha_param, 1, 4);
        SET semana_seleccionada = SUBSTRING(fecha_param, 6, 2);
        
        -- Calcular fecha de inicio y fin de la semana
        SET fecha_inicio = DATE_ADD(
            MAKEDATE(anio_seleccionado, 1), 
            INTERVAL (semana_seleccionada - 1) WEEK
        );
        SET fecha_fin = DATE_ADD(fecha_inicio, INTERVAL 7 DAY);
        
    ELSE
        -- Para filtro mensual, extraer año y mes
        SET anio_seleccionado = SUBSTRING(fecha_param, 1, 4);
        SET mes_seleccionado = SUBSTRING(fecha_param, 6, 2);
        
        -- Calcular fecha de inicio y fin del mes
        SET fecha_inicio = STR_TO_DATE(CONCAT(anio_seleccionado, '-', mes_seleccionado, '-01'), '%Y-%m-%d');
        SET fecha_fin = LAST_DAY(fecha_inicio);
        SET fecha_fin = DATE_ADD(fecha_fin, INTERVAL 1 DAY);
    END IF;

    -- Consulta principal con filtro de fechas mejorado
    SELECT 
        v.Cod_Venta,
        pv.Cod_Producto,
        p.Nombre AS Nombre_Producto,
        pv.Cantidad_Venta,
        ROUND(SUM(pv.Precio_Venta * pv.Cantidad_Venta), 2) AS Monto_Total,
        DATE_FORMAT(pv.Fecha_salida, '%Y-%m-%d') AS Fecha_Venta
    FROM 
        Venta v
    JOIN 
        ProductVenta pv ON v.Cod_Venta = pv.Cod_Venta
    JOIN 
        Producto p ON p.Cod_Producto = pv.Cod_Producto
    WHERE
        pv.Fecha_salida >= fecha_inicio
        AND pv.Fecha_salida < fecha_fin
    GROUP BY 
        v.Cod_Venta, pv.Cod_Producto, p.Nombre, pv.Cantidad_Venta, pv.Fecha_salida;
END ;;
