CREATE DEFINER=`user`@`%` PROCEDURE `sp_reporte_ventas_empleado`(
    IN p_filtro VARCHAR(20),
    IN p_fecha VARCHAR(20),
    IN p_empleado_id INT
)
BEGIN
    DECLARE v_start_date DATE;
    DECLARE v_end_date DATE;
    
    IF p_filtro = 'diario' THEN
        -- Filtro diario (ya funciona correctamente)
        SELECT 
            v.Cod_Venta,
            pv.Cod_Producto,
            pr.Nombre AS Nombre_Producto,
            pv.Cantidad_Venta,
            pv.Precio_Venta * pv.Cantidad_Venta AS Monto_Total,
            pv.Fecha_salida AS Fecha_Venta
        FROM Venta v
        JOIN ProductVenta pv ON v.Cod_Venta = pv.Cod_Venta
        JOIN Producto pr ON pv.Cod_Producto = pr.Cod_Producto
        WHERE v.Cod_Empleado = p_empleado_id
        AND DATE(pv.Fecha_salida) = p_fecha;
    
    ELSEIF p_filtro = 'semanal' THEN
        -- Calcular inicio y fin de semana basado en la fecha recibida
        SET v_start_date = DATE_SUB(p_fecha, INTERVAL WEEKDAY(p_fecha) DAY);
        SET v_end_date = DATE_ADD(v_start_date, INTERVAL 6 DAY);
        
        SELECT 
            v.Cod_Venta,
            pv.Cod_Producto,
            pr.Nombre AS Nombre_Producto,
            pv.Cantidad_Venta,
            pv.Precio_Venta * pv.Cantidad_Venta AS Monto_Total,
            pv.Fecha_salida AS Fecha_Venta
        FROM Venta v
        JOIN ProductVenta pv ON v.Cod_Venta = pv.Cod_Venta
        JOIN Producto pr ON pv.Cod_Producto = pr.Cod_Producto
        WHERE v.Cod_Empleado = p_empleado_id
        AND DATE(pv.Fecha_salida) BETWEEN v_start_date AND v_end_date;
    
    ELSEIF p_filtro = 'mensual' THEN
        -- Calcular inicio y fin de mes basado en la fecha recibida
        SET v_start_date = DATE_FORMAT(p_fecha, '%Y-%m-01');
        SET v_end_date = LAST_DAY(p_fecha);
        
        SELECT 
            v.Cod_Venta,
            pv.Cod_Producto,
            pr.Nombre AS Nombre_Producto,
            pv.Cantidad_Venta,
            pv.Precio_Venta * pv.Cantidad_Venta AS Monto_Total,
            pv.Fecha_salida AS Fecha_Venta
        FROM Venta v
        JOIN ProductVenta pv ON v.Cod_Venta = pv.Cod_Venta
        JOIN Producto pr ON pv.Cod_Producto = pr.Cod_Producto
        WHERE v.Cod_Empleado = p_empleado_id
        AND DATE(pv.Fecha_salida) BETWEEN v_start_date AND v_end_date;
    END IF;
END ;;
DELIMITER ;
